import imgProduct01 from "../../images/image-product-1.jpg";
import thmb01 from "../../images/image-product-1-thumbnail.jpg";
import thmb02 from "../../images/image-product-2-thumbnail.jpg";
import thmb03 from "../../images/image-product-3-thumbnail.jpg";
import thmb04 from "../../images/image-product-4-thumbnail.jpg";

const Product = () => {
  return (
    <div className="product box-border px-20 py-14 ">
      <img src={imgProduct01} alt="image-product" className=" rounded-2xl mb-6 mx-auto" />
      <ul className="thumbnails flex justify-between ">
        <li className="group rounded-lg overflow-hidden border-transparent hover:border-primary-1 border-4 w-3/12">
          <a href="#">
            <img src={thmb01} alt="thumbnail-1 " className="rounded-lg group-hover:opacity-25" />
          </a>
        </li>
        <li className="rounded-md overflow-hidden w-1/5">
          <img src={thmb02} alt="thumbnail-2" />
        </li>
        <li className="rounded-md overflow-hidden w-1/5">
          <img src={thmb03} alt="thumbnail-3" />
        </li>
        <li className="rounded-md overflow-hidden w-1/5">
          <img src={thmb04} alt="thumbnail-4" />
        </li>
      </ul>
    </div>
  );
};

export default Product;
